import React, {Component} from 'react';
import './bootstrap.css';
import Form from './Form.js';
import './img.css';

class Section extends Component{

  render(){
    const doctors = [
      {
        'name' : 'Nathan Sumilang',
        'description' : 'TODO'
      },
      {
        'name' : 'Gwenith Cancino',
        'description' : 'TODO description'
      }
    ];
    //TODO : Add images to the slideshow
    const slideImages = [
      {
        'url' : 'TODO URL',
        'alt' : 'Alt Image'
      }
    ];
    return(
      //<AboutUs />
      <section className="container-fluid">
        <Home id="home" images={slideImages} />
        <Form />
        <ContactUs id="contact"/>
      </section>
    );
  }
}



const ContactUs = () =>{
  return(
    <section id="contact" className="row">
      <h1 className="col-md-12 text-center">Contact Us</h1>
      <div className="offset-md-4 col-md-4">
        <h5 className="text-center">Hours of Operations</h5>
        <p className="text-center"><strong>Monday - Friday</strong></p> 
        <p className="text-center">7AM to 4:30PM</p>
        <h5 className="text-center">Saturday - Sunday</h5>
        <p className="text-center">Closed</p>
        <h5 className="text-center">Email: </h5>
        <h5 className="text-center">Phone Number: </h5>
      </div>
      <div className="col-md-6 text-center">
        <h5>Address: </h5>
        <p>Address Line 1</p>
        <p>City, State Zip</p>
      </div>
    </section>
  );
}

export default Section;
